Rabbids Go Home is the fourth installment in the Rabbids sub-series of the Rayman series of video games and is the first stand-alone title in the sub-series. The game's plot centers on the efforts of the titular Rabbids to collect as many human objects as they can and create a huge pile high enough to reach the Moon, all the while avoiding the extermination attempts by the &quot;Verminators&quot;, who wish to gain back the stuff the Rabbids have stolen.

The game received generally favorable reviews from critics, who praised the game's humor, soundtrack and accessible gameplay, though some noted the game's low difficulty. The reviews for the Nintendo DS version were mixed.
